import React from 'react'
import './Banner.css'
import { Button } from '@material-ui/core';
function Banner() {
  return (
    <div className='banner' >
      <div className='banner__info'>
        <h1>Let us take care of you</h1>
        <h5>Book your stay at one of our world famous luxury, eco-friendly hotels</h5>
        <Button variant='outlined'> Start Travelling </Button>
      </div>
    </div>
  )
}

export default Banner
